import React from 'react'

function Pagination({ filterdDishes , itemsperPage , currentPage , setCurrentPage}) {

    let numberofPages=[]

    for(let i=1; i<=Math.ceil(filterdDishes.length/itemsperPage); i++){
        numberofPages.push(i)

    }

    function currentpageseter(event , pageNu){
        let currentPage = event.target.id
        setCurrentPage(currentPage)
        console.log('page is =',currentPage);
        console.log('page num is =',pageNumber);
    }

    let page= numberofPages.map((pageNumber)=>{
        return(
            <li id={pageNumber} onClick={()=>currentpageseter(pageNumber)}>
                {pageNumber}
            </li>
        )
    })

  return (
    <section>
        <ul className='pagination flex'>
            {page}
        </ul>
    </section>

  )
}

export default Pagination
